Mylimiausia kortelė tavo telefone – naudokis lojalumo programos Mylimiausia teikiamais privalumais tiesiog savo išmaniajame!
Net trijų partnerių – CIRCLE K, ČILI PIZZA ir GINTARINĖ VAISTINĖ – naudos vienoje programėlėje.

Tegul apsipirkti bus dar lengviau – atsisiųskite programėlę Mylimiausia ir naudokitės ja vietoje plastikinės kortelės. Dar neturite kortelės Mylimiausia?
Greitai ir patogiai susikurkite naują virtualią kortelę arba pridėkite savo fizinę kortelę į programėlę ir: 
- naudokitės virtualia lojalumo kortele Mylimiausia partnerių prekybose vietose. Užteks tik parodyti QR kodą ekrane ar priliesti banko terminalą telefonu;
- stebėkite sukauptų Mylimiausia lojalumo eurų likutį „Čili pizza“ ir „Gintarinė vaistinė“ bei matykite savo apsilankymų istoriją;
- koreguokite savo asmeninius duomenis;
- raskite arčiausią partnerio prekybos vietą.

Turite pastabų ar pasiūlymų? Lauksime Jūsų laiško adresu info@mylimiausia.lt

